<!DOCTYPE html><html lang="en"><head>
    <meta charset="UTF-8">
    <link rel="icon" type="image/svg+xml" href="/vite.svg">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Vite + React + TS</title>
    <script crossorigin="">import('https://harxv25comporchestratorfront.netlify.app/index.js').finally(() => {
            
    const qiankunLifeCycle = window.moudleQiankunAppLifeCycles && window.moudleQiankunAppLifeCycles['app11'];
    if (qiankunLifeCycle) {
      window.proxy.vitemount((props) => qiankunLifeCycle.mount(props));
      window.proxy.viteunmount((props) => qiankunLifeCycle.unmount(props));
      window.proxy.vitebootstrap(() => qiankunLifeCycle.bootstrap());
      window.proxy.viteupdate((props) => qiankunLifeCycle.update(props));
    }
  
          })</script>
    <link rel="stylesheet" crossorigin="" href="https://harxv25comporchestratorfront.netlify.app/index.css">
  </head>
  <body>
    <div id="root"></div>

    <script>
      // Prevent accidental refreshes during development
      if (window.location.href.includes('localhost') || window.location.href.includes('127.0.0.1') || window.location.href.includes('harx.ai')) {
        window.addEventListener('beforeunload', function(e) {
          if (document.querySelector('[data-processing="true"]')) {
            e.preventDefault();
            e.returnValue = 'You have unsaved changes. Are you sure you want to leave?';
            return e.returnValue;
          }
        });
      }
    </script>
  

<script>
  const createDeffer = (hookName) => {
    const d = new Promise((resolve, reject) => {
      window.proxy && (window.proxy[`vite${hookName}`] = resolve)
    })
    return props => d.then(fn => fn(props));
  }
  const bootstrap = createDeffer('bootstrap');
  const mount = createDeffer('mount');
  const unmount = createDeffer('unmount');
  const update = createDeffer('update');

  ;(global => {
    global.qiankunName = 'app11';
    global['app11'] = {
      bootstrap,
      mount,
      unmount,
      update
    };
  })(window);
</script></body></html>
